message:
Peste 80.000 de persoane au manifestat aseară la Tel Aviv împotriva faptului că guvernul lui Benjamin Netanyahu este urmărit penal în mai multe cazuri de corupție și împotriva unui proiect de lege de reformă judiciară care urmărește să sporească puterea aleșilor asupra sistemului judiciar.
